package com.wolken.wolkenapp.dto;

public class GunsDTO {
private int gunsId;
private String gunsName;
private String brandName;
private String serialNo;
private double price;
private String type;
private int noOfBullet;
private String madeIn;
public GunsDTO() {
	// TODO Auto-generated constructor stub
}
public int getGunsId() {
	return gunsId;
}
public void setGunsId(int gunsId) {
	this.gunsId = gunsId;
}
public String getGunsName() {
	return gunsName;
}
public void setGunsName(String gunsName) {
	this.gunsName = gunsName;
}
public String getBrandName() {
	return brandName;
}
public void setBrandName(String brandName) {
	this.brandName = brandName;
}
public String getSerialNo() {
	return serialNo;
}
public void setSerialNo(String serialNo) {
	this.serialNo = serialNo;
}
public double getPrice() {
	return price;
}
public void setPrice(double price) {
	this.price = price;
}
public String getType() {
	return type;
}
public void setType(String type) {
	this.type = type;
}
public int getNoOfBullet() {
	return noOfBullet;
}
public void setNoOfBullet(int noOfBullet) {
	this.noOfBullet = noOfBullet;
}
public String getMadeIn() {
	return madeIn;
}
public void setMadeIn(String madeIn) {
	this.madeIn = madeIn;
}

}
